  if (x.length > 0)
  {
    localStorage.setItem('cellphone',x);
  }

}
const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Capturar Numero de Telefono</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonItem>
          <IonLabel>Default Label</IonLabel>
          <IonInput placeholder="Numero de Celular" onIonChange={e => setText(e.detail.value!)}></IonInput>
        </IonItem>


      </IonContent>
    </IonPage>
  );
};

export default Tab1;
